import './App.css';
import Greet,{Home,ExpenseEntryItem} from './components/Home'


const name = "Grape Juice"
const amount = 30.00
const spendDate = new Date("2020-10-10")
const category = "Food"


function App() {
  return (
    <div className="App">
      <Greet name = "Keerthana"/>
      <Home/> 
      <ExpenseEntryItem 
               name={name} 
               amount={amount} 
               spendDate={spendDate} 
               category={category} />,
    </div>
  );
}

export default App;
